import DispatchNavbar from "./dispatchnavbar";
import Users from "../users";

class Dispatch extends Component {
  state = {};
  render() {
    return (
      <div>
        <DispatchNavbar />
        <Users />
      </div>
    );
  }
}

export default Dispatch;
